
export{Pipelines}
import{List}from'./list/list.min.js'
import{Form}from'./form/form.min.js'
class Pipelines{static api='/api/pipeline-registry/pipelines';static w_api='/api/worker-registry/workers';constructor(ctr){this.list=new List(ctr);this.form=new Form(ctr);}
draw(sp,{pl}){if(!sp&&!pl){return this.list.draw();}
if(sp&&pl&&sp.has('action')&&sp.get('action')==='details'){return this.details.draw(pl);}
if(sp&&!pl&&sp.has('action')&&sp.get('action')==='new'){return this.form.draw();}
if(sp&&pl&&sp.has('action')&&sp.get('action')==='edit'){return this.form.drawEdit(pl);}}}